import React from "react";

function DarkMood() {
  return (
    <>
      <header
        style={{
          display: "flex",
          width: "100%",
          border: "1px solid",
          justifyContent: "space-between",
        }}
      >
        <a style={{ textDecoration: "none" }} href="">
          DarkMood
        </a>
        <nav style={{ width: "100%" }}>
          <ul
            style={{
              display: "flex",
              width: "50%",
              border: "1px solid",
              justifyContent: "space-between",
              marginLeft: "40%",
            }}
          >
            <li style={{ textDecoration: "none" }}>Home</li>
            <li style={{ textDecoration: "none" }}>About</li>
            <li style={{ textDecoration: "none" }}>Services</li>
          </ul>
        </nav>
      </header>
    </>
  );
}

export default DarkMood;
